    const cards = props.productData.map((product, index) => {
        return (
            <Card>
                <Card.Header>{product.title}</Card.Header>
                    <Card.Body>
                        <Card.Text>
                            {product.descripton}
                        </Card.Text>
                </Card.Body>
            </Card>
        );
      });
      return (cards);
    }



export default Cards
